            id="rating"
            label="Rating"
            onChange={onTextChange}
            fullWidth
            />
            <TextField
            id="traffic"
            label="Traffic"
            onChange={onTextChange}
            fullWidth
            />
             <TextField
            id="accident"
            label="Accident"
            onChange={onTextChange}
            fullWidth
            />
            <Button onClick={onSubmit}>Submit</Button>
         </div>
        </FormControl>
    )
}
